<?php

require_once 'kitku/kitku.php';

$kitku = new Kitku();

//$kitku::dump($kitku);

if (!empty($_FILES) || !empty($_POST)) {
    
    echo "_FILES\r\n";
    $image = new KitkuImage ($_FILES['the-file']['tmp_name'], $kitku->home['server'].'images/', '_FILES', 'path');
    $image->save($kitku->imageMaxSizes);
    echo "\r\n";

    echo "_POST\r\n";
    $image = new KitkuImage ($_POST['base64'], $kitku->home['server'].'images/', '_POST', 'base64');
    $image->save($kitku->imageMaxSizes);
    echo "\r\n";

    exit();
}

?>

<form id='test' onsubmit="return new_post(event);">
    <input type="file" name="the-file"></input>
    <br />
    <input type="submit"></input>
</form>

<script>

function new_post(e) {
    e.preventDefault();

    console.clear();
    
    const form = document.forms['test'];
    const fd = new FormData(form);
    fd.append(
        'base64','data:image/gif;base64,');

    const xhttp = new XMLHttpRequest();
            xhttp.open('POST', 'test.php', true);
            xhttp.send(fd);

    xhttp.onreadystatechange = function() {
        if (this.readyState == 4 && this.status == 200){
            const result = this.responseText;
            console.log(result);
        }
    }
}

</script>